INSERT INTO `house_features` VALUES (134, 82, '房源介绍', '这个民宿隐藏在山间，被绿树和青山环绕。木制结构的房间设计简洁舒适，落地窗让您可以尽情欣赏周围的自然景色。清晨，您可以在阳台上喝杯咖啡，感受大自然的宁静和美好。房间内配备了温馨的火炉和舒适的床铺，让您度过一个温馨惬意的山间假期。');
