INSERT INTO `house_features` VALUES (138, 84, '房源介绍', '这个民宿坐落在山涧之间，被清澈的溪水环绕。房间采用木质装饰，自然的色彩和材质营造出温馨舒适的氛围。您可以在阳台上欣赏山涧的美景，感受大自然的静谧和清新。房间内还配备了舒适的大床和木制家具，让您度过一个静心放松的山涧假期。');
