INSERT INTO `house_features` VALUES (302, 166, '房源介绍', '这个民宿坐落在湖畔，周围是清澈的湖水和翠绿的树林。别墅内部装饰舒适温馨，配备了宽敞的客厅和明亮的卧室。您可以在湖畔漫步，欣赏湖水倒影，感受大自然的清新与宁静。');
INSERT INTO `house_features` VALUES (303, 167, '位置周边', '位置情况:\n周边情况:-距春熙路/太古里，地铁4个站，约8分钟到\n达;\n-距文殊院，步行约5分钟到达;\n距宽窄巷子，地铁4个站，约10分钟到达;\n距火车北站，地铁1站;\n距双流机场，打车约40分钟到达(也可步行200米机场专线2号线直达);');
INSERT INTO `house_features` VALUES (304, 167, '房源介绍', '这个民宿位于古老的城市中心，周围是古老的建筑和石板路。房间充满古典气息，古朴的家具和复古的装饰品让您感受到历史的厚重和沧桑，仿佛穿越回过去。在这里，您可以漫步古城街道，探索古老的文化和历史遗迹。房间内配备了舒适的大床和设施齐全的浴室，为您带来舒适和便利。');
INSERT INTO `house_features` VALUES (305, 168, '位置周边', '位置情况:\n周边情况:-距春熙路/太古里，地铁4个站，约8分钟到\n达;\n-距文殊院，步行约5分钟到达;\n距宽窄巷子，地铁4个站，约10分钟到达;\n距火车北站，地铁1站;\n距双流机场，打车约40分钟到达(也可步行200米机场专线2号线直达);');
INSERT INTO `house_features` VALUES (306, 168, '房源介绍', '这个民宿设有别致的露营帐篷，位于郊外的野外营地。帐篷内装饰简约舒适，配备舒适的床铺和温馨的照明，让您可以在大自然的怀抱中享受露营的乐趣。在这里，您可以与大自然亲密接触，感受大自然的神奇与美妙。');
