INSERT INTO `house_features` VALUES (314, 172, '房源介绍', '这个民宿位于郊外的绿色庄园，周围是茂密的森林和广阔的草地。别墅内部装饰典雅豪华，配备了一流的设施和服务。您可以在这里享受到私密宁静的度假时光，感受大自然的美妙和神奇。');
INSERT INTO `house_features` VALUES (315, 173, '位置周边', '位置情况:\n周边情况:-距春熙路/太古里，地铁4个站，约8分钟到\n达;\n-距文殊院，步行约5分钟到达;\n距宽窄巷子，地铁4个站，约10分钟到达;\n距火车北站，地铁1站;\n距双流机场，打车约40分钟到达(也可步行200米机场专线2号线直达);');
INSERT INTO `house_features` VALUES (316, 173, '房源介绍', '这个民宿位于宁静的乡村，被绿树和花园环绕。别墅内部宽敞明亮，家具摆放简洁大方。室外有私人花园和露台，供您享受户外时光。房间内提供了一流的设施和舒适的床铺，确保您拥有一段难忘的度假体验。');
INSERT INTO `house_features` VALUES (317, 174, '位置周边', '位置情况:\n周边情况:-距春熙路/太古里，地铁4个站，约8分钟到\n达;\n-距文殊院，步行约5分钟到达;\n距宽窄巷子，地铁4个站，约10分钟到达;\n距火车北站，地铁1站;\n距双流机场，打车约40分钟到达(也可步行200米机场专线2号线直达);');
INSERT INTO `house_features` VALUES (318, 174, '房源介绍', '这个民宿是一栋宽敞的家庭式别墅，适合一家人或多个好友一同度假。别墅内部设施齐全，拥有多间卧室和宽敞的客厅，配备了娱乐设施和厨房。您可以在这里举办家庭聚会，共度愉快时光。');
INSERT INTO `house_features` VALUES (319, 175, '位置周边', '位置情况:\n周边情况:-距春熙路/太古里，地铁4个站，约8分钟到\n达;\n-距文殊院，步行约5分钟到达;\n距宽窄巷子，地铁4个站，约10分钟到达;\n距火车北站，地铁1站;\n距双流机场，打车约40分钟到达(也可步行200米机场专线2号线直达);');
INSERT INTO `house_features` VALUES (320, 175, '房源介绍', '这个民宿拥有一个宽敞的户外露台，让您可以尽情享受户外生活。露台上配备了舒适的户外家具和烧烤设施，您可以在这里举办户外聚会、烧烤晚餐或者欣赏星空。房间内装饰简约时尚，配备舒适的床铺和现代家电，为您提供一段难忘的户外度假体验。');
INSERT INTO `house_features` VALUES (321, 176, '位置周边', '位置情况:\n周边情况:-距春熙路/太古里，地铁4个站，约8分钟到\n达;\n-距文殊院，步行约5分钟到达;\n距宽窄巷子，地铁4个站，约10分钟到达;\n距火车北站，地铁1站;\n距双流机场，打车约40分钟到达(也可步行200米机场专线2号线直达);');
INSERT INTO `house_features` VALUES (322, 176, '房源介绍', '这个民宿位于海边，拥有壮丽的海景。房间装饰充满海洋元素，蓝色调的家具和海洋风格的装饰品营造出轻松愉悦的度假氛围。您可以在私人露台上欣赏日出日落，感受海风的清爽。房间内还配备了舒适的大床和浴室，让您能够在海边尽情放松。');
